int findMaxConsecutiveOnes(char* nums, int numsSize) {
    int count = 0;
    int max = 0;
    int cur = 0;
    while (cur < numsSize)
    {
        while (cur < numsSize && nums[cur++] == 1)
        {
            count++;
        }
        if (count > max)
        {
            max = count;
        }
        count = 0;
    }
    return max;
}
